import React from "react";
import Footer from "../../components/Footer";
import Header from "../../components/Header";
import Book from "../../components/Book";

import { 
  ContainerBooks,
  Title
 } from "./styles";

 const Gallery = () => {
  const books = [
    {
      book_cover: "https://picsum.photos/id/237/200/300",
      title: "title 1",
      description: "description 1",
    },
    {
      book_cover: "https://picsum.photos/id/238/200/300",
      title: "title 2",
      description: "description 2",
    },
    {
      book_cover: "https://picsum.photos/id/239/200/300",
      title: "title 3",
      description: "description 3",
    },
    {
      book_cover: "https://picsum.photos/id/240/200/300",
      title: "title 4",
      description: "description 4",
    },
    {
      book_cover: "https://picsum.photos/id/241/200/300",
      title: "title 5",
      description: "description 5",
    },
  ];
  return (
    <>
      <Header />
      <Title>Gallery</Title>
      <ContainerBooks>
        Gallery
        {books.map((book, index) => (
          <Book
            image={book.book_cover}
            title={book.title}
            showInfo={book.description}
            key={index}
          />
        ))}
        {/* <Book
          image={books[1].book_cover}
          title={books[1].title}
          showInfo={books[1].description}
        />
        <Book
          image={books[2].book_cover}
          title={books[2].title}
          showInfo={books[2].description}
        /> */}
      </ContainerBooks>
      <Footer />
    </>
  );
};

export default Gallery;
